clipboardDelimiter.description:
/** Specify the delimiter to use when copying to clipboard.
     * Default: `\t`
    */

suppressReactUi.description:
/** @deprecated Set to true to enable the experimental React UI. Works with React framework only.
     * It is planned the next major release of the grid will drop support of the legacy React engine,
     * hence this property is deprecated as will be removed in the next major release. */

loadingCellRenderer.description:
/** Provide your own loading cell renderer to use when data is loading via a DataSource.
    * See [Loading Cell Renderer](https://www.ag-grid.com/javascript-data-grid/component-loading-cell-renderer/) for framework specific implementation details.
    */

detailCellRenderer.description:
/** Provide a custom `detailCellRenderer` to use when a master row is expanded.
    * See [Detail Cell Renderer](https://www.ag-grid.com/javascript-data-grid/master-detail-custom-detail/) for framework specific implementation details.
    */

loadingOverlayComponent.description:
/** Provide a custom loading overlay component.
    * See [Loading Overlay Component](https://www.ag-grid.com/javascript-data-grid/component-overlay/#simple-loading-overlay-component) for framework specific implementation details.
    */

noRowsOverlayComponent.description:
/** Provide a custom no rows overlay component.
    * See [No Rows Overlay Component](https://www.ag-grid.com/javascript-data-grid/component-overlay/#simple-no-rows-overlay-component) for framework specific implementation details.
    */

cellFlashDelay.description:
/** To be used in combination with `enableCellChangeFlash`, this configuration will set the delay in milliseconds of how long a cell should remain in its "flashed" state.
     * Default: `500`
     */

cellFadeDelay.description:
/** To be used in combination with `enableCellChangeFlash`, this configuration will set the delay in milliseconds of how long the "flashed" state animation takes to fade away after the timer set by `cellFlashDelay` has completed.
     * Default: `1000`
     */

fullWidthCellRenderer.description:
/** Provide your own cell renderer component to use for full width rows.
    * See [Full Width Rows](https://www.ag-grid.com/javascript-data-grid/full-width-rows/) for framework specific implementation details.
    */

groupRowRenderer.description:
/** Provide the Cell Renderer to use when `groupDisplayType = 'groupRows'`.
    * See [Group Row Cell Renderer](https://www.ag-grid.com/javascript-data-grid/grouping-group-rows/#providing-cell-renderer) for framework specific implementation details.
    */

cacheOverflowSize.description:
/** How many extra blank rows to display to the user at the end of the dataset, which sets the vertical scroll and then allows the grid to request viewing more rows of data.
     * Default: `1`
     */

infiniteInitialRowCount.description:
/** How many extra blank rows to display to the user at the end of the dataset, which sets the vertical scroll and then allows the grid to request viewing more rows of data.
     * Default: `1`
     */

serverSideInitialRowCount.description:
/** Set how many loading rows to display to the user for the root level group.
     * Default: `1`
     */

suppressServerSideInfiniteScroll.description:
/** When `true`, the Server-side Row Model will suppress Infinite Scrolling and load all the data at the current level.
     * Default: `false`
     */

cacheBlockSize.description:
/** How many rows for each block in the store, i.e. how many rows returned from the server at a time.
     * Default: `100`
     */

serverSideFilterOnServer.description:
/** When enabled, Filtering will be done on the server. Only applicable when `suppressServerSideInfiniteScroll=true`.
     * Default: `false`
     */

getBusinessKeyForNode.description:
/** Return a business key for the node. If implemented, each row in the DOM will have an attribute `row-id='abc'` where `abc` is what you return as the business key.
     * This is useful for automated testing, as it provides a way for your tool to identify rows based on unique business keys.
     */

onComponentStateChanged.description:
/** Only used by Angular, React and VueJS AG Grid components (not used if doing plain JavaScript).
     * If the grid receives changes due to bound properties, this event fires after the grid has finished processing the change.
     */

componentStateChanged.description:
/** Only used by Angular, React and VueJS AG Grid components (not used if doing plain JavaScript).
     * If the grid receives changes due to bound properties, this event fires after the grid has finished processing the change.
     */

api.description:
/** The Grid Api for interacting with the grid.
     * Set by the grid on init, set to null on destroy.
     */

columnApi.description:
/** The Column Api for interacting with the grid columns.
     * Set by the grid on init, set to null on destroy.
     */
